import React from "react";
import "./Note";
import "../notes";

function newNotes(nDetail) {
  return (
    <Note key={nDetail.key} title={nDetail.title} content={nDetail.content} />
  );
}

function noteDetails() {
  return (
    <div>
      <Header />
      {notes.map(newNotes)}
      <Footer />
    </div>
  );
}

export default noteDetails;
